import Card from '../../components/Card';

export const Products = (props) => {
  const infos = props.items.slice(0, props.offset * 5);

  return (
    <div>
      {infos &&
        infos.map((item) => (
          <div key={item.carClassId}>
            <Card.CarImg src={item.image} alt={`${item.carClassNfame} 차량`} />

            <Card.CarTitle>{item.carClassName}</Card.CarTitle>

            <p>{item.price}원</p>
            <p>{item.discountPercent}%</p>

            <p>{item.carTypeTags}</p>
            <p>{item.year}년</p>
            <p>{item.drivingDistance}km</p>
            <p>{item.regionGroups}</p>
          </div>
        ))}
    </div>
  );
};

export default Products;
